import {ProductItem} from "./product-item";

export class User {
  id: number;
  firstName: string;
  lastName: string;
  gender: string;
  email: string;
  phone: string;
  password: string;


  constructor(id: number, firstName: string, lastName: string, gender: string, email: string, phone: string, password: string) {
    this.id = id;
    this.firstName = firstName;
    this.lastName = lastName;
    this.gender = gender;
    this.email = email;
    this.phone = phone;
    this.password = password;
  }
}


export class UsersResponse {
  users: User[];
  total: number;
  skip: number;
  limit: number;


  constructor(users: User[], total: number, skip: number, limit: number) {
    this.users = users;
    this.total = total;
    this.skip = skip;
    this.limit = limit;
  }
}
